result:
query ($page:Int){
   properties: allStrapiProperty(perPage: 3, page: $page) @paginate {
    pageInfo {
      totalPages
      currentPage
    }
   edges {
    node{
      title
      slug
      address
      location
      status
      bedrooms
      bathroom
      price
      description
      area
       project_status {
        name
        slug
      }
      property_type {
        name
        slug
      }
       images {
        url
      }
    }
    }
  }
    strapi {
    global {
      siteName
      favicon {
        url
      }
      defaultSeo {
        metaTitle
        metaDescription
        shareImage {
          url
        }
      }
    }
    homepage {
      hero {
        title
      }
      seo {
        metaTitle
        metaDescription
        shareImage {
          url
        }
      }
    }

  }
}
